import React from "react";
import CountdownTimer from "react-component-countdown-timer";

export default class Timer extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      seconds: 0,
      minutes: 0,
      hours: 0,
    };
  }
  render() {
    return (
      <div>
        <h5>Timer</h5>
        {this.state.hours}
        {this.state.minutes}
        {this.state.seconds}

        <button
          type="button"
          className="btn btn-outline-dark waves-effect"
        >
          My Favorite Button
        </button>
      </div>
    );
  }
}
